INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'article', 0, 1, 1, 'und', 0, 'Universitas Muhammadiyah Surakarta (UMS) adalah lembaga pendidikan tinggi di bawah persyarikatan Muhammadiyah. UMS berdiri berdasarkan Surat Keputusan Menteri Pendidikan dan Kebudayaan RI No. 0330/O/1981 tanggal 24 Oktober 1981 sebagai perubahan bentuk dari IKIP Muhammadiyah Surakarta.\r\n\r\nSebelum menjadi UMS, secara kelembagaan UMS berasal dari Fakultas Keguruan dan Ilmu Pendidikan (FKIP) Universitas Muhammadiyah Jakarta Cabang Surakarta yang didirikan pada tahun 1957. Para perintisnya antara lain Ibu Sudalmiyah Suhud Rais, Bapak Radjab Bulan Hadipurnomo, Bapak Muhammad Syafa’at Habib, Ibu Sulastri Gito Atmodjo, dan KH Syahlan Rosyidi.\r\n\r\nPada tanggal 18 September 1958, lembaga tersebut diresmikan oleh Bapak Wali Kota Madya Surakarta H.M Shaleh Werdhisastro. Pada saat diresmikan,. Perguruan Tinggi ini baru memiliki 51 mahasiswa, 6 orang karyawan dan 7 orang dosen. Asset tersebut modal awal berdirinya FKIP Universitas Muhammadiyah Jakarta Cabang Surakarta yang berlokasi di Jalan Overste Sudiarto Nomor 60 Surakarta.\r\n\r\nSebagai Dekan (Rektor saat itu) adalah Prof. Drs. Abdullah Sigit, Guru Besar Universitas Gadjah Mada dan sekretarisnya Bapak Drs. M. Syafa’at Habib. Adapun jurusan yang dibuka adalah Pendidkan Umum, Ekonomi Umum dan Islamic Studies-Pendidikan Agama Islam-- tingkat Sarjana Muda, dengan status terdaftar.\r\n\r\nPada tahun 1963, jurusan-jurusan tersebut mendapatkan Status disamakan (mendapatkan penghargaan sama dengan ijazah perguruan tinggi negeri yang setaraf untuk tingkat Sarjana Muda) berdasarkan surat keputusan Menteri Perguruan Tinggi dan Ilmu Pengetahuan Nomor 106/A tahun 1963.\r\n\r\nPada tahun 1965, FKIP Muhammadiyah Cabang Surakarta mendapatkan izin untuk berdiri sendiri dan menjadi dua lembaga Pendidikan Tinggi, yaitu Institut Keguruan dan Ilmu Pendidikan (IKIP) Muhammadiyah Surakarta, di bawah koordinasi Departemen Perguruan Tinggi dan Ilmu Pengetahuan dan Institut Agama Islam Muhammadiyah (IAIM) di bawah koordinasi Departemen Agama. IKIP Muhammadiyah Surakarta berdiri dengan jurusan-jurusan Pendidikan Umum (PU), Ekonomi Umum (EU) berdasarkan Surat Keputusan Menteri Perguruan tinggi dan Ilmu Pengetahuan No. 337/B-SWT/1965, dan IAIM dengan jurusan Tarbiyah/Pendidikan Agama Islam dan Jurusan Ushuluddin/Perbandingan Agama bersadarkan Keputusan Menteri Agama nomor 21 tahun 1966.\r\n\r\nTahun 1967, IKIP Muhammadiyah Surakarta menambah satu jurusan yaitu Civic Hukum (CH) dengan status Terdaftar dan mendapatkan izin sebagai induk Perguruan Tinggi Muhammadiyah se-Jawa Tengah yang terdiri dari IKIP Muhammadiyah Klaten, Magelang, Kudus, Purwokerto, Kebumen, Wates, Temanggung, Wonogiri, Sukoharjo, Karanganyar, Banjarnegara, Prambanan, Purbalingga, Wonosari, dan Sragen. Setelah berkembang, cabang-cabang tersebut akhirnya berdiri sendiri menjadi perguruan tinggi yang mandiri seperti IKIP Muhammadiyah Purwokerto, IKIP Muhammadiyah Purworejo dan IKIP Muhammadiyah Magelang.\r\n\r\nPada tahun 1979, Drs. H. Mohamd Djazman, Rektor IKIP Muhammadiyah Surakarta saat itu, memprakarsai berdirinya Universitas Muhammadiyah Surakarta dengan menggabungkan IKIP Muhammadiyah Surakarta dan IAIM Surakarta. Prakarsa tersebut kemudian terwujud dengan turunnya SK Menteri Pendidikan dan Kebudayaan Nomor 0330/O/1981 tentang berubahnya status IKIP Muhammadiyah Surakarta menjadi Universitas Muhammadiyah Surakarta.\r\n\r\nPada tahun 1993, Prof. Abdul Malik Fajar menjadi Rektor UMS sampai dengan 1996. Prof. Malik merangkap antara UMS dan Univ Muhmammadiyah Malang, prof. Malik Fajar kemudian hijrah ke Jakarta untuk menjadi dirjen di departemen agama, menjadi mentere Agama, dan menjadi Mendiknas. Pada masa Prof Malik banyak dilakukan terobosan sehingga program studi di UMS banyak mendapat status disamakan.\r\n\r\nPada tahun 1996 sampai 2004 Prof. Dochak Latif menjadi rektor UMS. Prof Dochak melanjutkan program Prof Malik Fajar mengembankan program program studi baru, program paska sarjana dan Program studi kedokteran.\r\n\r\nTahun 2005 sampai sekarang Prof. Bambang Setiaji melanjutkan menjadi rektor UMS. Program studi dibuka makin banyak sampai 52 program studi. Kerja sama dengan luar negeri double degree dilakukan dengan 5 negara, UK, Australia, Korea, Taiwan, dan USA. Manajmen dibenahi dengan mendirikan dana pensiun, dana abadi, dan cash manajemen untuk perbaikan manajemen keuangan.\r\n\r\nSejalan dengan tuntutan dan perkembangan masyarakat, beberapa fakultas dikembangkan dengan membuka jurusan baru seperti Fakultas Ekonomi dengan Jurusan Ilmu Ekonomi Studi Pembangunan, Fakultas Teknik dengan Jurusan Teknik Arsitektur, Elektro, Teknik Kimia, dan Teknik Industri. Pada tahun 1993/1994 UMS membuka program Pendidikan Ahli Madya Kesehatan (D3) dengan Jurusan Keperawatan, Fisioterapi, Gizi, dan Kesehatan Lingkungan. Tahun 1995/1996 membuka Program Pasca Sarjana dengan program Magister Studi Islam (MSI). Selanjutnya pada tahun 1999 membuka Fakultas Farmasi dan Magister Manajemen (MM) serta tahun 2001 membuka Magister Ilmu Hukum, Teknik Sipil, dan Manajemen Pendidikan. Pada tahun 2003/2004 dibuka program S1 dan D4 Fakultas Ilmu-Ilmu Kesehatan, dengan jurusan Kesehatan Masyarakat, Keperawatan, Fisioterapi, dan menyusul dibuka program studi Pendidikan Dokter tahun akademik 2004/2005. Pada perkembangannya empat program studi terakhir ini diintegrasikan dengan program D-3 Kesehatan dengan nama Fakultas Ilmu Kedokteran. Pada tahun 2005, UMS mendapat izin untuk membuka program Magister Psikologi dan di susul program Magister Pengkajian Bahasa tahun 2006. Pada tahun 2006, FKIP membuka jurusan baru Program D2 Pendidikan Guru Taman Kanak-Kanak (PGTK). Pada tahun 2006 juga dibuka Fakultas Komunikasi dan Informatika dengan satu jurusan yaitu Ilmu Komunikasi, disusul dibukanya jurusan Teknik Informatika (Perangkat Lunak) pada tahun 2007. Pada tahun 2007 FKIP juga membuka jurusan baru, yaitu Pendidikan Guru Sekolah Dasar (PGSD). Tahun 2007 juga ditandai dengan langkah UMS menuju universitas kelas dunia yaitu dengan dibukanya program Internasional kerjasama UMS dengan Kingston University di Inggris untuk program studi automotive engineering dan kerjasama UMS dengan Universiti Kebangsaan Malaysia untuk program studi Bussiness Administration dan Medical Law. Sampai saat ini, UMS mengelola 42 (empat puluh dua) program studi dan 2 (dua) program internasional. Di samping itu, UMS juga menyelenggarakan pendidikan profesi, seperti profesi Apoteker, Psikologi, Advokat, Ners, dan Guru. Landasan untuk menuju universitas kelas dunia semakin kuat dengan masuknya UMS dalam kelompok 50 Promissing Indonesian Universities.', '', 'filtered_html'),
('node', 'article', 0, 2, 2, 'und', 0, 'Unit Kegiatan Mahasiswa (UKM) Taekwondo mengadakan Pekan Olahraga dan Seni Mahasiswa (Porsema) di Gor  kampus 2, pada Kamis (10/12/2015). Kegiatan tersebut di selenggarakan untuk mengapresiasikan minat bakat mahasiwa dalam bidang olah raga dan seni.\r\n\r\nSeperti yang diungkapkan Rika Yunitahardiyati selaku ketua panitia Porsema, bahwa kegiatan Porsema tersebut  merupakan kegiatan perdana sebagai ajang apresiasi dalam bidang olahraga dan seni. “Kan Porsema tahun lalu pernah ada, dan ini pertama kalinya kita mengadakan Porsema ini, jadi kita pengen mengapresiasikan minat bakat mereka dalam bidang olahraga dan seni,” ungkapnya, Kamis (10/12/2015).\r\n\r\nRika juga berharap supaya  kegiatan tersebut  kedepannya semakin baik lagi dan juga kegiatan tersebut menjadi kegiatan  rutin setiap tahun. ” Semoga buat Badan Eksekutif Mahasiswa (BEM)  mengadakan acaranya seperti ini lagi, tidak hanya tahun ini saja, agar kita bisa tahu seberapa bakat mereka dalam bidang olahraga dan seni ini,” harapnya.', '', 'filtered_html'),
('node', 'article', 0, 3, 3, 'und', 0, 'Pesma KH Mas Mansyur mengadakan acara donor darah yang diadakan oleh International Student Organization (ISO) , program kerja  dari pengabdian masyarakat.  Kegiatan ini merupakan kelanjutan dari acara Pesma Games.\r\n\r\n“Ini salah satu proker teman-teman dari pengabdian masyarakat ISO, masih dalam rangkaian milad, ini adalah acara terakhir,“ kata Abdul Malik A.H selaku ketua panita, Rabu (16/12/2015).\r\n\r\nSosialisasi mendadak yang dilakukan oleh pihak panitia menjadi kendala kegiatan donor darah, yang rencananya dilaksanakan pada Sabtu (19/12/2015) terpaksa dimajukan menjadi hari Rabu. Abdul mengatakan sosialisasi yang dilakukan sangat mendadak. “Menginfokan donor darah ini mendadak, karena PMI ngasih tahunya mendadak,” tambahnya.\r\n\r\nSalah seorang pendonor, Angga Pratama mengaku baru kali pertama mendonorkan darah. Ia  mengatakan  justru merasa lebih segar dibandingkan sebelumnya. “Baru pertama ikut donor darah. Dulu masih takut-takut ketika diajukan teman, ini malah pingin lagi karena tidak menakutkan seperti yang dibayangkan dan merasa lebih segar dan tidak lelah,” ungkapnya, Rabu (1612/2015).\r\n\r\nAngga berharap kegiatan ini ada follow up-nya dan jangan selesai pada hari ini saja. “Tetap istiqomah dalam acara ini,” harapnya.', '', 'filtered_html'),
('node', 'article', 0, 4, 4, 'und', 0, 'Universitas Muhammadiyah Surakarta merupakan salah satu kampus besar di Jawa Tengah. Kampus ini terletak di dekat perbatasan Kota Solo dan Kabupaten Sukoharjo. Kenapa harus UMS? Mari kita tengok sekilas tentang UMS.\r\n\r\nA. UMS Dalam Angka\r\n\r\n- Didirikan pada tahun 1958\r\n- jumalah mahasiswa aktif lebih dari 25.000 orang\r\n- Dosen lebih dari 1.000 orang\r\n- Karyawan lebih dari 300 orang\r\n- 12 Fakultas dengan 54 Program Studi & Program Khusus\r\n- Sekolah Vokasi dengan 4 Program Studi\r\n- Sekolah Pascasarjana dengan 12 Program Magister (S2) dan 1 Program Doktor (S3)\r\n- 6 Program Profesi (Profesi Apoteker, Magister Psikologi Profesi, Profesi Advokat, Profesi Ners, Profesi Dokter (CoAss), rofesi Dokter Gigi (CoAss))\r\n- Alumni lebih dari 100.000 orang\r\n\r\n\r\nB. Kerjasama Luar Negeri\r\n\r\n- Double Degree Programs: UMS-Kingston Univ. UK; UMS-Derby Univ. UK; UMS-Charles Darwin Univ. Australia; UMS-Kyungdong Univ. Korea Selatan; UMS-NTUST Taiwan; UMS-NTUT Taiwan\r\n- Program of Academic Recharging: Sheffield Univ. UK; Nottingham Univ. UK; Minnesota Univ. USA. Waterloo Univ. Canada, Curtin Univ. of Technology, Australia\r\n- Mahasiswa asing dan Student Exchange: USA, Libya, Thailand, Malaysia, Filipina, Sudan, Irak, Rumania, Slovakia, Palestina, Jordania, Jerman, Jepang, Myanmar dan Polandia\r\n\r\n\r\nC. Aset\r\n\r\nUMS mempunyai 5 kampus yang terintegrasi dengan system IT dengan luas area sekitar 40 ha, dan Hutan Pendidikan (Edu Park) seluas 6,5 ha yang dijadikan sebagai public space.\r\nPenyelenggaraan pendidikan di UMS ditunjang fasilitas pembelajaran yang sangat memadai, mulai dari ruangan kelas yang representatif, laboratorium yang lengkap, dan perpustakaan berbasis teknologi informasi.\r\n\r\n\r\nD. Prestasi UMS\r\n\r\n- Peringkat 2 BIPA (Bahasa Indonesia untuk Penutur Asing) Tingkat Nasional 2014 dalam Test Uji Kemampuan Bahasa Indonesia dan Juara 3 dalam Lomba Penulisan Esai Bahasa Indonesia\r\n- Pustakawan terbaik Tingkat Kopertis Wilayah VI 2014\r\n- Mahasiswa Berprestasi Terbaik Tingkat Kopertis Wilayah VI 2014 dan satu-satunya wakil PTS yang masuk 15 finalis Tingkat Nasional\r\n- Penerima Beasiswa S3 Luar Negeri dari DIKTI Diknas terbanyak untuk PTS di Indonesia selama 3 tahun terakhir\r\n- Sebagai Universitas peringkat 8 se-Indonesia pada PIMNAS ke XXIV di Makassar\r\n- Sebagai salah satu universitas yang dinilai baik oleh QS Stars\r\n- Terpilih sebagai Perguruan Tinggi Penyelenggara Sertifikasi Dosen (PTP Serdos) Mandiri dan Sertifikasi Guru (Sergur)\r\n- Terpilih sebagai Perguruan Tinggi Penyelenggara PLPG\r\n- Peraih hibah-hibah institusi, a.l.: TPSDP, Semi-Que, PHK-I, dll\r\n- Masuk 50 Promising Universities di Indonesia (sumber dari DIKTI)\r\n- Mendapat kategori sebagai Perguruan Tinggi Utama Bidang Penelitian\r\n- Terakreditasi secara institusi dengan nilai B (Baik)\r\n\r\nE. Hidup di Solo\r\n\r\nSiapa yang tidak kenal dengan Kota Solo, kota dengan kehidupan yang dinamis dan selalu saja muncul hal-hal baru yang kita temui hampir setiap hari. Kota dengan sentuhan budaya batik yang sangat kental, keramah tamahan penduduknya, menjadi daya pikat tersendiri untuk kota ini. Ditambah lagi biaya hidup yang relatif murah serta akses transportasi yang mudah memang sepantasnya Solo mendapat julukan “The Spirit of Java”.\r\n\r\nF. Makan Murah di Sekitar Kampus UMS\r\n\r\nKuliah di Universitas Muhammadiyah Surakarta tentu erat kaitannya dengan biaya hidup untuk keperluan sehari-hari, baik itu makan, kost maupun transportasi. Untuk biaya makan tentu harus dipikirkan baik-baik, karena komponen penting ini memerlukan perhitungan yang cermat. Boleh percaya atau tidak, makanan yang dijajakan disekitaran kampus UMS bisa ditebus dengan harga Rp 7 ribuan untuk sekali makan. Soal pilihan menu tentu sangat beragam, dari masakan khas Jawa sampai masakan luar Jawapun tersedia sangat lengkap.\r\nDisekitaran kampus UMS juga banyak ditemui penajaja Wedangan/HIK (Hidangan Istimewa Kampung) yang menawarkan berbagai pilihan makanan. Yang paling khas adalah “Nasi Kucing” dan berbagai macam aneka sate. Dengan modal Rp 5-10 ribuan bisa makan kenyang disini.\r\n\r\nG. Hematnya Biaya Hidup di Sekitar Kampus UMS\r\nBiaya hidup selama kuliah di UMS tidaklah mahal, hanya sekitar Rp 350-750 ribu perbulannya, tergantung fasilitas yang ditawarkan. Sedangkan untuk kost tahunan antara Rp 1,5-3 juta, tergantung dari lokasinya juga, semakin strategi dengan akses kampus biasanya semakin mahal. Biasanya semakin masuk ke kampung biayanya semakin murah, apalagi jika ditanggung oleh beberapa orang sekaligus.\r\n\r\nH. Transportasi di Sekitar Kampus UMS\r\nLokasi kampus UMS sangat mudah dijangkau dengan berbagai kendaraan pribadi maupun umum. Bagi yang melakukan perjalanan dengan bus dan angkot dari arah timur maupun barat dapat langsung turun di depan gapura UMS', '', 'filtered_html');
