INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES
(1, 'node', ' sejarah ums universitas muhammadiyah surakarta ums adalah lembaga pendidikan tinggi di bawah persyarikatan muhammadiyah ums berdiri berdasarkan surat keputusan menteri pendidikan dan kebudayaan ri no 330 o 1981 tanggal 24 oktober 1981 sebagai perubahan bentuk dari ikip muhammadiyah surakarta sebelum menjadi ums secara kelembagaan ums berasal dari fakultas keguruan dan ilmu pendidikan fkip universitas muhammadiyah jakarta cabang surakarta yang didirikan pada tahun 1957 para perintisnya antara lain ibu sudalmiyah suhud rais bapak radjab bulan hadipurnomo bapak muhammad syafa at habib ibu sulastri gito atmodjo dan kh syahlan rosyidi pada tanggal 18 september 1958 lembaga tersebut diresmikan oleh bapak wali kota madya surakarta hm shaleh werdhisastro pada saat diresmikan perguruan tinggi ini baru memiliki 51 mahasiswa 6 orang karyawan dan 7 orang dosen asset tersebut modal awal berdirinya fkip universitas muhammadiyah jakarta cabang surakarta yang berlokasi di jalan overste sudiarto nomor 60 surakarta sebagai dekan rektor saat itu adalah prof drs abdullah sigit guru besar universitas gadjah mada dan sekretarisnya bapak drs m syafa at habib adapun jurusan yang dibuka adalah pendidkan umum ekonomi umum dan islamic studiespendidikan agama islam tingkat sarjana muda dengan status terdaftar pada tahun 1963 jurusanjurusan tersebut mendapatkan status disamakan mendapatkan penghargaan sama dengan ijazah perguruan tinggi negeri yang setaraf untuk tingkat sarjana muda berdasarkan surat keputusan menteri perguruan tinggi dan ilmu pengetahuan nomor 106 a tahun 1963 pada tahun 1965 fkip muhammadiyah cabang surakarta mendapatkan izin untuk berdiri sendiri dan menjadi dua lembaga pendidikan tinggi yaitu institut keguruan dan ilmu pendidikan ikip muhammadiyah surakarta di bawah koordinasi departemen perguruan tinggi dan ilmu pengetahuan dan institut agama islam muhammadiyah iaim di bawah koordinasi departemen agama ikip muhammadiyah surakarta berdiri dengan jurusanjurusan pendidikan umum pu ekonomi umum eu berdasarkan surat keputusan menteri perguruan tinggi dan ilmu pengetahuan no 337 bswt 1965 dan iaim dengan jurusan tarbiyah pendidikan agama islam dan jurusan ushuluddin perbandingan agama bersadarkan keputusan menteri agama nomor 21 tahun 1966 tahun 1967 ikip muhammadiyah surakarta menambah satu jurusan yaitu civic hukum ch dengan status terdaftar dan mendapatkan izin sebagai induk perguruan tinggi muhammadiyah sejawa tengah yang terdiri dari ikip muhammadiyah klaten magelang kudus purwokerto kebumen wates temanggung wonogiri sukoharjo karanganyar banjarnegara prambanan purbalingga wonosari dan sragen setelah berkembang cabangcabang tersebut akhirnya berdiri sendiri menjadi perguruan tinggi yang mandiri seperti ikip muhammadiyah purwokerto ikip muhammadiyah purworejo dan ikip muhammadiyah magelang pada tahun 1979 drs h mohamd djazman rektor ikip muhammadiyah surakarta saat itu memprakarsai berdirinya universitas muhammadiyah surakarta dengan menggabungkan ikip muhammadiyah surakarta dan iaim surakarta prakarsa tersebut kemudian terwujud dengan turunnya sk menteri pendidikan dan kebudayaan nomor 330 o 1981 tentang berubahnya status ikip muhammadiyah surakarta menjadi universitas muhammadiyah surakarta pada tahun 1993 prof abdul malik fajar menjadi rektor ums sampai dengan 1996 prof malik merangkap antara ums dan univ muhmammadiyah malang prof malik fajar kemudian hijrah ke jakarta untuk menjadi dirjen di departemen agama menjadi mentere agama dan menjadi mendiknas pada masa prof malik banyak dilakukan terobosan sehingga program studi di ums banyak mendapat status disamakan pada tahun 1996 sampai 2004 prof dochak latif menjadi rektor ums prof dochak melanjutkan program prof malik fajar mengembankan program program studi baru program paska sarjana dan program studi kedokteran tahun 2005 sampai sekarang prof bambang setiaji melanjutkan menjadi rektor ums program studi dibuka makin banyak sampai 52 program studi kerja sama dengan luar negeri double degree dilakukan dengan 5 negara uk australia korea taiwan dan usa manajmen dibenahi dengan mendirikan dana pensiun dana abadi dan cash manajemen untuk perbaikan manajemen keuangan sejalan dengan tuntutan dan perkembangan masyarakat beberapa fakultas dikembangkan dengan membuka jurusan baru seperti fakultas ekonomi dengan jurusan ilmu ekonomi studi pembangunan fakultas teknik dengan jurusan teknik arsitektur elektro teknik kimia dan teknik industri pada tahun 19931994 ums membuka program pendidikan ahli madya kesehatan d3 dengan jurusan keperawatan fisioterapi gizi dan kesehatan lingkungan tahun 19951996 membuka program pasca sarjana dengan program magister studi islam msi selanjutnya pada tahun 1999 membuka fakultas farmasi dan magister manajemen mm serta tahun 2001 membuka magister ilmu hukum teknik sipil dan manajemen pendidikan pada tahun 20032004 dibuka program s1 dan d4 fakultas ilmuilmu kesehatan dengan jurusan kesehatan masyarakat keperawatan fisioterapi dan menyusul dibuka program studi pendidikan dokter tahun akademik 20042005 pada perkembangannya empat program studi terakhir ini diintegrasikan dengan program d3 kesehatan dengan nama fakultas ilmu kedokteran pada tahun 2005 ums mendapat izin untuk membuka program magister psikologi dan di susul program magister pengkajian bahasa tahun 2006 pada tahun 2006 fkip membuka jurusan baru program d2 pendidikan guru taman kanakkanak pgtk pada tahun 2006 juga dibuka fakultas komunikasi dan informatika dengan satu jurusan yaitu ilmu komunikasi disusul dibukanya jurusan teknik informatika perangkat lunak pada tahun 2007 pada tahun 2007 fkip juga membuka jurusan baru yaitu pendidikan guru sekolah dasar pgsd tahun 2007 juga ditandai dengan langkah ums menuju universitas kelas dunia yaitu dengan dibukanya program internasional kerjasama ums dengan kingston university di inggris untuk program studi automotive engineering dan kerjasama ums dengan universiti kebangsaan malaysia untuk program studi bussiness administration dan medical law sampai saat ini ums mengelola 42 empat puluh dua program studi dan 2 dua program internasional di samping itu ums juga menyelenggarakan pendidikan profesi seperti profesi apoteker psikologi advokat ners dan guru landasan untuk menuju universitas kelas dunia semakin kuat dengan masuknya ums dalam kelompok 50 promissing indonesian universities universitas muhammadiyah surakarta ums merupakan satu dari 164 perguruan tinggi muhammadiyah ptm dan satu di antara 1890 perguruan tinggi swasta pts di indonesia ', 0),
(2, 'node', ' taekwondo apresiasikan bakat dan minat lewat porsema unit kegiatan mahasiswa ukm taekwondo mengadakan pekan olahraga dan seni mahasiswa porsema di gor kampus 2 pada kamis 10122015 kegiatan tersebut di selenggarakan untuk mengapresiasikan minat bakat mahasiwa dalam bidang olah raga dan seni seperti yang diungkapkan rika yunitahardiyati selaku ketua panitia porsema bahwa kegiatan porsema tersebut merupakan kegiatan perdana sebagai ajang apresiasi dalam bidang olahraga dan seni kan porsema tahun lalu pernah ada dan ini pertama kalinya kita mengadakan porsema ini jadi kita pengen mengapresiasikan minat bakat mereka dalam bidang olahraga dan seni ungkapnya kamis 10122015 rika juga berharap supaya kegiatan tersebut kedepannya semakin baik lagi dan juga kegiatan tersebut menjadi kegiatan rutin setiap tahun semoga buat badan eksekutif mahasiswa bem mengadakan acaranya seperti ini lagi tidak hanya tahun ini saja agar kita bisa tahu seberapa bakat mereka dalam bidang olahraga dan seni ini harapnya unit kegiatan mahasiswa ukm taekwondo mengadakan pekan olahraga dan seni mahasiswa porsema di gor kampus 2 ', 0),
(3, 'node', ' rayakan milad pesma iso adakan donor darah pesma kh mas mansyur mengadakan acara donor darah yang diadakan oleh international student organization iso program kerja dari pengabdian masyarakat kegiatan ini merupakan kelanjutan dari acara pesma games ini salah satu proker temanteman dari pengabdian masyarakat iso masih dalam rangkaian milad ini adalah acara terakhir kata abdul malik ah selaku ketua panita rabu 16122015 sosialisasi mendadak yang dilakukan oleh pihak panitia menjadi kendala kegiatan donor darah yang rencananya dilaksanakan pada sabtu 19122015 terpaksa dimajukan menjadi hari rabu abdul mengatakan sosialisasi yang dilakukan sangat mendadak menginfokan donor darah ini mendadak karena pmi ngasih tahunya mendadak tambahnya salah seorang pendonor angga pratama mengaku baru kali pertama mendonorkan darah ia mengatakan justru merasa lebih segar dibandingkan sebelumnya baru pertama ikut donor darah dulu masih takuttakut ketika diajukan teman ini malah pingin lagi karena tidak menakutkan seperti yang dibayangkan dan merasa lebih segar dan tidak lelah ungkapnya rabu 16122015 angga berharap kegiatan ini ada follow upnya dan jangan selesai pada hari ini saja tetap istiqomah dalam acara ini harapnya pesma kh mas mansyur mengadakan acara donor darah ', 0);
